To terminate a C program, you can use the following methods:

1. **Using the `return` statement**: The `return` statement can be used to exit a function and return control to the calling function. If the `main` function is the entry point of the program, the `return` statement will terminate the program. For example:

   ```c
int main() {
    // Program code
    return 0;  // or any other integer value
}
```

2. **Using the `exit` function**: The `exit` function is a standard library function that terminates the program immediately. It takes an integer argument that will be used as the program's exit status. For example:

   ```c
#include <stdlib.h>

int main() {
    // Program code
    exit(0);  // or any other integer value
}
```

3. **Using the `exit` function with a signal**: The `exit` function can also be called with a signal, such as `SIGINT` (interrupt signal) or `SIGTERM` (termination signal), to terminate the program. For example:

   ```c
#include <signal.h>
#include <stdlib.h>

void signal_handler(int sig) {
    exit(0);
}

int main() {
    signal(SIGINT, signal_handler);
    // Program code
}
```

4. **Using a loop**: If you want to create a loop that will continue until a certain condition is met, you can use a `while` loop to repeatedly check the condition and exit the loop when it is met. For example:

   ```c
int main() {
    int i = 0;
    while (i < 10) {
        // Program code
        i++;
    }
    return 0;
}
```

5. **Using `atexit` function**: The `atexit` function is used to register a function to be called when the program exits. This can be used to perform cleanup tasks before the program terminates. For example:

   ```c
#include <stdlib.h>

void cleanup() {
    // Cleanup code
}

int main() {
    atexit(cleanup);
    // Program code
    exit(0);
}
```

Note: The `atexit` function is not a direct way to terminate the program, but it can be used to perform cleanup tasks before the program exits.
